import React from 'react'
import {A} from './Recommendstyle';
export default function Recommend() {
    return (
        <div style={{padding:"2px "}}>
        <A href="#">
            <div>
                RECOMMEND AN EXCHANGE
            </div>
            <div style={{fontSize:"35px",padding:"0px 0px 7px 25px"}}>&#8594;</div>
        </A>
        </div>
    )
}
